interface Props {
    subs: Array<{
        nick: string
        subMonth: number
        avatar: string
        description?: string
    }>
}

const List: React.FunctionComponent= ({ subs }: Props) => {
    return (
        <ul>
            {
                subs.map(sub => {
                    return (
                        <li key={sub.nick}>
                            <img src={sub.avatar} alt='Avatar' />
                            <h4>{sub.nick} (<small>{sub.subMonth}</small>)</h4>
                            <p>{sub.description?.substring(0, 100)}</p>
                        </li>
                    )
                })
            }
        </ul>
    )
}

export default List
